 display {i in 1 .. R_BLADDER} (sum {j in bmltsIndex_BLADDER_150: (i,j) in voxelbmlt_BLADDER_150} x150[j]*intensities_BLADDER_150[i,j]) +(sum {j in bmltsIndex_BLADDER_225: (i,j) in voxelbmlt_BLADDER_225} x225[j]*intensities_BLADDER_225[i,j]) +(sum {j in bmltsIndex_BLADDER_255: (i,j) in voxelbmlt_BLADDER_255} x255[j]*intensities_BLADDER_255[i,j]) +(sum {j in bmltsIndex_BLADDER_275: (i,j) in voxelbmlt_BLADDER_275} x275[j]*intensities_BLADDER_275[i,j]) +(sum {j in bmltsIndex_BLADDER_295: (i,j) in voxelbmlt_BLADDER_295} x295[j]*intensities_BLADDER_295[i,j])  > test_1DVH_BLADDER.txt;
